import { CREATE_ROOM } from "../actions";

const initialState = {
    room: 0
}

const testReducer = (state = initialState, action) => {
    console.log(action.type);
    switch (action.type) {
        case CREATE_ROOM:
            console.log(state);
            // state.room++;
            return state.room;
        default:
            return state.room;
    }
}

export default testReducer;
